import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import ThemeContextWrapper from '../components/themeContextWrapper';

ReactDOM.render(
    <ThemeContextWrapper>
        <App />  
    </ThemeContextWrapper>, 
    document.getElementById('root')
);
